import React, { useState } from 'react';
import { Route, Routes, useNavigate } from 'react-router-dom';
<Route path="/companylogin" element={<CompanyLogin />} />

import CompanyRegister from './CompanyRegister';
import StudentPage from './studentpage';
import ScadPage from './scadpage';
import FacultyPage from './facultypage';
import CompanyPage from './companypage';

function App() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  // This state holds registered company login info
  const [registeredCompany, setRegisteredCompany] = useState(null);

  const navigate = useNavigate();

  const handleLogin = (e) => {
    e.preventDefault();

    // Dummy users
    if (email === 'student@guc.edu.eg' && password === 'student123') {
      navigate('/studentpage');
    } else if (email === 'scad@guc.edu.eg' && password === 'scad123') {
      navigate('/scadpage');
    } else if (email === 'faculty@guc.edu.eg' && password === 'faculty123') {
      navigate('/facultypage');
    } else if (
      registeredCompany &&
      email === registeredCompany.companyEmail &&
      password === registeredCompany.password
    ) {
      navigate('/companypage');
    } else {
      alert('Invalid credentials');
    }
  };

  const handleCompanyRegister = () => {
    navigate('/company-register');
  };

  return (
    <div>
      <Routes>
        <Route
          path="/"
          element={
            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
              <div style={{ padding: '20px', border: '1px solid #ddd', borderRadius: '8px' }}>
                <h2>Login</h2>
                <form>
                  <div>
                    <label>Email:</label>
                    <input
                      type="email"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                      required
                      placeholder="Enter your email"
                      style={{ width: '100%', padding: '8px', marginBottom: '10px' }}
                    />
                  </div>
                  <div>
                    <label>Password:</label>
                    <input
                      type="password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                      required
                      placeholder="Enter your password"
                      style={{ width: '100%', padding: '8px', marginBottom: '10px' }}
                    />
                  </div>
                  <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
                    <button
                      type="submit"
                      onClick={handleLogin}
                      style={{ padding: '10px', backgroundColor: '#4CAF50', color: 'white', border: 'none', borderRadius: '4px' }}
                    >
                      Login
                    </button>
                    <button
                      type="button"
                      onClick={handleCompanyRegister}
                      style={{ padding: '10px', backgroundColor: '#FFA500', color: 'white', border: 'none', borderRadius: '4px' }}
                    >
                      Register as a Company
                    </button>
                  </div>
                </form>
              </div>
            </div>
          }
        />
        <Route
          path="/company-register"
          element={<CompanyRegister setRegisteredCompany={setRegisteredCompany} />}
        />
        <Route path="/studentpage" element={<StudentPage />} />
        <Route path="/scadpage" element={<ScadPage />} />
        <Route path="/facultypage" element={<FacultyPage />} />
        <Route path="/companypage" element={<CompanyPage />} />
      </Routes>
    </div>
  );
}

export default App;
